using System;
using System.Drawing;
using System.IO;

namespace CosmosKernel1
{
    static class HZK16
    {
        static string hzk16Base64p0 = "";
        static string hzk16Base64p1 = "";
        static string hzk16Base64p2 = "";
        static string hzk16Base64p3 = "";
        static string hzk16Base64p4 = "";
        static string hzk16Base64p5 = "";
        static string hzk16Base64p6 = "";
        static string hzk16Base64p7 = "";

        static MemoryStream memoryStream = new MemoryStream(Convert.FromBase64String(hzk16Base64p0 + hzk16Base64p1 + hzk16Base64p2 + hzk16Base64p3 + hzk16Base64p4 + hzk16Base64p5 + hzk16Base64p6 + hzk16Base64p7));
        static int i, j, k, flag, offset, usedWidth, start, end, last;
        static byte[] font, encoding;
        static Color colorDivide2;

        public static void DrawString(this Graphics graphics, Color color, string s, int x, int y)
        {
            colorDivide2 = Color.FromArgb(color.R / 2, color.G / 2, color.B / 2);

            string[] lines = s.Split('\n');
            for (int d = 0; d < lines.Length; d++)
            {
                usedWidth = 0;
                for (int l = 0; l < lines[d].Length; l++)
                {
                    end = 0;
                    start = 16;
                    last = 0;

                    if (lines[d][l] == ' ')
                    {
                        usedWidth += 8;
                        continue;
                    }

                    encoding = GB2312.GetBytes(lines[d][l]);
                    font = new byte[32];
                    offset = (94 * (encoding[0] - 0xA0 - 1) + (encoding[1] - 0xA0 - 1)) * 32;
                    memoryStream.Seek(offset, SeekOrigin.Begin);
                    memoryStream.Read(font, 0, font.Length);

                    for (k = 0; k < 16; k++)
                    {
                        for (j = 0; j < 2; j++)
                        {
                            for (i = 0; i < 8; i++)
                            {
                                flag = font[k * 2 + j] & (0x80 >> i);

                                if (flag != 0)
                                {
                                    graphics.DrawPoint(color, x + ((j * 8) + i) + usedWidth, y + k + (d * 16));

                                    if (last == 0)
                                    {
                                        if ((j * 8) + i < start)
                                        {
                                            start = (j * 8) + i;
                                        }

                                        //graphics.DrawPoint(colorDivide2, x + (((j * 8) + i) - 1) + usedWidth, y + k + (d * 16));
                                    }
                                }
                                else
                                {
                                    if (last != 0)
                                    {
                                        if ((j * 8) + i > end)
                                        {
                                            end = (j * 8) + i;
                                        }

                                        graphics.DrawPoint(colorDivide2, x + (((j * 8) + i)) + usedWidth, y + k + (d * 16));
                                    }
                                }

                                last = flag;
                            }
                        }
                    }
                    usedWidth += end;
                }
            }
        }
    }
}
